import { Box } from "@mui/material";
import { SIZE } from "../../constant/common";

function Size() {
    return (
        <div>
            <div>
                {
                    SIZE.map((key) => {
                        return (
                            <Box component="span" sx={{ p: 1, border: '1px solid black' }}>
                                <label>{key.value}</label>
                            </Box>
                        )
                    })
                }
            </div>
        </div>
    );
}

export default Size;
